import LandingHeader from "../component/LandingHeader";

function Landing() {
    return (
        <>
        <LandingHeader />
        <div className="landing-container">
            <div><h1>Encuentra tu media <br/>musical</h1></div>
            <div>
                <button className="button">Crear una cuenta</button>
            </div>
        </div>
        </>
    );
}

export default Landing;
